content:
보기 불편하네요;;
전적으로 율하 탓도 아닌데 쏘아붙이고 또 그것 때문에 저렇게 까지 한다?..... 이건 좀 아닌 듯
신아 한테 호감도 뚝,,,,

저런 여자애 싫더라
누굴 좋아한다는 이유로 좋아하는 사람과 가까운 사람이랑 어떻게든 해 보려고 하는 사람;;
좋아하면 좋아한다고 말하면 될 거 갖다가 저러면 이용하는 거잖음;;
고백하는 게 어렵다고 해도 혼자 용기 내서 해야 좋은 거지 굳이 제3자?를 엮어야 하나;

&#x27;영원보다 짧잖아요&#x27;
&#x27;그럼 도망이라도 갈까?&#x27;
진짜 로맨틱한 사람들 끼리끼리 만난듯ㅋㅋㅋㅋㅋㅋㅋ 
대명이 처음에 쌤 보고 오글거린다 할 게 아니었음 지가 더 함ㅠ

대명이 코트 입은거 보고 개설렘.....
하.....

나 남잔데...ㅡ;

대훈이는 선생님인걸 알고 있었고
선생님은 대훈이가 자기 학생인걸 모르고있었지만
대훈이는 처음엔 별 마음없다가 차츰 마음이 생겨가서 말을 하려고했지만 번번이 타이밍을 놓치고 후에 밝혔지만 선생님 또한 말할 틈을 안주며 자기표현하기 바빳던걸로 보였는데;

근데 대명이가 &quot;죽으라면 죽을테니까...&quot; 라고 하니까
우영쌤이 &quot;그럼 죽어!!&quot; 한거 왤케 웃기지ㅋㅋㅋㅋㅋㅋ 이토준지 만화인줄... 
&quot;죽을만큼 사랑해!!&quot;
&quot;그럼 죽어..!&quot;

와..  담임샘으로 들어오시네.
대명이 들킬 거 생각하니 짠하다;;
그냥 너 얼른 졸업해..ㅠ

우산 씌워주는데 갑자기
스승~의 은~혜~는 하~늘 같아서~
가 떠오르는 나란 여자 메마른 여자 ㅜㅜ;;;;;

&quot;진천아, 그 얘기 들었어?&quot;
&quot;무슨 얘기?&quot;
&quot;내가 너랑 데이트하고 싶다는 얘기♡&quot;

왜 여기서 친구가 제일 잘못했다는 말이 나오지? 아무리 봐도 저 구남친이 제일 씹쓰레기인데;;; 댓글 충격적..
저 친구가 선생님이랑 구남친 사이를 정확하게 모를 수도 있는거고 만화에선 설명도 없는데 지레짐작 오진다
저렇게 협박하는 구남친이 대명이 말대로 예비범죄자에 씹쓰레기 아님?;

너무 진부한 클리셰네요; 
비밀이 생김 -&gt; 친구가 오해함 -&gt; 절정 -&gt; 오해가 풀림 
너무 진부해요..

진천이 여자친구가 제일 문제 일꺼 같은데
아직 나오지는 않지만, 그 모범적인 여학생이 회장님의 딸~~~~~ 이란 -_-;;;
그런 설정이 나오지 않을까 추측해봄.

그림체가 언뜻봐도 자세히
봐도 네이ㅂ 작가 누구랑 되게 비슷하네
쉴드쳐줄 일이 아니라 진짜 비슷함..;;

아 설렌다(*´ლ`*) 
진천이는 어린시절부터 다정하고, 호경이는 다른건 필요없고 그애랑 찍은것만 달라고할때&gt; &lt; 
작가님 얘네 둘은 꼭 잘되리라 믿어요

아이돌에 관심이 없어서 그냥 그런가보다했는데
샤이니팬이 정말 많은가보다;
프로필 생일만보고도 알아챌 정도라니..

임율하문다해커플
서대명선우영커플 
여자가 좋아하는걸 남자가 싫어하네 ;;

순간 도깨비 명대사 생각났네요.
&quot;운명은 내가 던진 질문일뿐, 답은 그대들이 찾아라&quot;
여튼 둘다 소름돋는 명대사다.

아니ㅋㄱㄱ버너 표정
&quot;카까커께카카카캐 아몰랑ㄱ커카커 일단 해ㄱ거카커&quot;
라는 기분

그레이트:&quot;가짜들의 세상은 이제 끝났어 이바닦은 이제 내가 뒤집는다&quot;
카이:&quot;가짜들의 세상은 이제 끝났어 이바닥은 이제 우리가 뒤집는다&quot;
비슷한대사 but 너무다른 뜻

그레이트도 문제지만 버너도 문제라고 버너 지금 죽기 일보직전 아냐???
살아있으면 똥이라도 닦지 죽으면 똥도 못 닦아
작가님 제발 이제 아무도 죽이지 말아주세요... ㅠㅠ;;
